/*
 * @lc app=leetcode.cn id=1345 lang=javascript
 *
 * [1345] 跳跃游戏 IV
给你一个整数数组 arr ，你一开始在数组的第一个元素处（下标为 0）。
每一步，你可以从下标 i 跳到下标：
i + 1 满足：i + 1 < arr.length
i - 1 满足：i - 1 >= 0
j 满足：arr[i] == arr[j] 且 i != j
请你返回到达数组最后一个元素的下标处所需的 最少操作次数 。
注意：任何时候你都不能跳到数组外面。

示例 1：
输入：arr = [100,-23,-23,404,100,23,23,23,3,404]
输出：3
解释：那你需要跳跃 3 次，下标依次为 0 --> 4 --> 3 --> 9 。下标 9 为数组的最后一个元素的下标。

示例 2：
输入：arr = [7]
输出：0
解释：一开始就在最后一个元素处，所以你不需要跳跃。

示例 3：
输入：arr = [7,6,9,6,9,6,9,7]
输出：1
解释：你可以直接从下标 0 处跳到下标 7 处，也就是数组的最后一个元素处。

示例 4：
输入：arr = [6,1,9]
输出：2

示例 5：
输入：arr = [11,22,7,7,7,7,7,7,7,22,13]
输出：3
提示：
1 <= arr.length <= 5 * 10^4
-10^8 <= arr[i] <= 10^8

class Solution {
    public int minJumps(int[] arr) {
        // 可以看成一张无向图，每个元素与它相邻的元素相连，同时还与它值相同的元素相连
        // 使用BFS从0搜索到n-1即可

        int n = arr.length;
        if (n == 1) {
            return 0;
        }

        // 记录相同值的元素有哪些下标
        Map<Integer, List<Integer>> map = new HashMap<>();
        for (int i = 0; i < n; i++) {
            map.computeIfAbsent(arr[i], v -> new ArrayList<>()).add(i);
        }

        // BFS使用的队列
        Queue<Integer> queue = new LinkedList<>();
        // 记录已经访问过的元素
        // 数组范围：1 <= arr.length <= 5 * 10^4
        // 使用数组比Set效率更优
        // 使用位图更优
        boolean[] visited = new boolean[n];
        
        queue.offer(0);
        visited[0] = true;

        int ans = 0;
        while (!queue.isEmpty()) {
            // 与二叉树的层序遍历类似
            int size = queue.size();
            while (size-- > 0) {
                int index = queue.poll();

                // 满足条件，直接返回
                if (index == n - 1) {
                    return ans;
                }

                // 把它相边的直接入队
                if (map.containsKey(arr[index])) {
                    for (int next : map.get(arr[index])) {
                        if (next != index && !visited[next]) {
                            queue.offer(next);
                            visited[next] = true;
                        }
                        // 剪枝：这个元素相连的都处理过了，后面再遍历到再处理肯定都已经访问过了，不如直接移除，可以减少遍历的次数
                        map.remove(arr[index]);
                    }
                }

                if (index + 1 <= n - 1 && !visited[index + 1]) {
                    queue.offer(index + 1);
                    visited[index + 1] = true;
                }

                if (index - 1 >= 0 && !visited[index - 1]) {
                    queue.offer(index - 1);
                    visited[index - 1] = true;
                }
            }

            ans++;
        }

        // 不会走到这里
        return -1;
    }
}

 */

