/**
 * @param {number[]} arr
 * @return {number}
 */
var minJumps = function (arr) {
    let map = new Map()
    for (let i = arr.length; i >= 0; i--) {
        if (arr[i] === arr[i + 1] && arr[i] === arr[i - 1]) {
            continue
        }
        if (!map.has(arr[i])) {
            map.set(arr[i], [])
        }
        map.get(arr[i]).push(i)
    }
    let visited = new Set()
    let queue = [[0, 0]]
    visited.add(0)
    while (queue.length) {
        let [idx, step] = queue.shift()
        if (idx - 1 >= 0 && !visited.has(idx - 1)) {
            queue.push([idx - 1, step + 1])
            visited.add(idx - 1)
        }
        if (idx + 1 < arr.length && !visited.has(idx + 1)) {
            if (idx + 1 === arr.length - 1) return step + 1;
            queue.push([idx + 1, step + 1])
            visited.add(idx + 1)
        }
        let canGo = map.get(arr[idx])
        if (canGo) {
            for (let i = canGo.length - 1; i >= 0; i--) {
                const idxCanGo = canGo[i]
                if (idxCanGo === arr.length - 1) return step + 1;
                if (!visited.has(idxCanGo) && idxCanGo !== idx - 1 && idxCanGo !== idx + 1) {
                    queue.push([idxCanGo, step + 1])
                    visited.add(idxCanGo)
                }
            }
            map.delete(arr[idx])
        }
    }
};
